import React,{useEffect} from "react";
import { useDispatch } from "react-redux";
import { startGetUsers } from "../../actions/userActions";

const Users = (props) => 
{
    const dispatch = useDispatch()
    useEffect(() => 
    {
        dispatch(startGetUsers())
    },[])
    return(
        <div>
            <h2>Listing Users</h2>
        </div>
    )
}
export default Users
